$(() => {
	$('.ticker-row').slick({
		infinite: true,
		autoplay: true,
		autoplaySpeed: 0,
		arrows: false,
		easing: 'linear',
		cssEase: 'linear',
		waitForAnimate: false,
		speed: 10000,
		centerMode: true,
		edgeFriction: 0,
		pauseOnFocus: false,
		pauseOnHover: false,
		pauseOnDotsHover: false,
		autoSlidesToShow: true,
		variableWidth: true,

	});

	$('.ticker-row-2').slick({
		infinite: true,
		rtl: true,
		autoplay: true,
		autoplaySpeed: 0,
		arrows: false,
		easing: 'linear',
		cssEase: 'linear',
		waitForAnimate: false,
		speed: 10000,
		centerMode: true,
		edgeFriction: 0,
		pauseOnFocus: false,
		pauseOnHover: false,
		pauseOnDotsHover: false,
		autoSlidesToShow: true,
		variableWidth: true,

	});

	// анимация
	AOS.init({
		duration: 1500,
		once: true
	});
	// select
	let select = function () {
		let selectHeader = document.querySelectorAll('.select__header');
		let selectItem = document.querySelectorAll('.select__item');
		if (selectHeader) {
			selectHeader.forEach((item) => {
				item.addEventListener('click', selectToggle)
			})

			selectItem.forEach((item) => {
				item.addEventListener('click', selectChoose)
			})

			function selectToggle() {
				this.parentElement.classList.toggle('is-active');
			}

			function selectChoose() {
				let text = this.innerText;
				let select = this.closest('.select');
				let currentText = select.querySelector(".select__current");
				currentText.innerText = text;
				select.classList.remove('is-active');
			}
		}

	}
	select();

	// слайдер main
	function mainSwaiper() {
		let mainSlaiderBox = document.querySelectorAll('.main-wrapp')
		if (mainSlaiderBox) {
			const mainSwiper = new Swiper('.main-wrapp', {
				pagination: {
					el: '.main-paginations'
				},
				speed: 800,
				effect: "creative",
				creativeEffect: {
					prev: {
						shadow: true,
						translate: ["-20%", 0, -1],

					},
					next: {
						translate: ["100%", 0, 0],
					}
				},

				autoHeight: true
			});



			let slideBtn = document.querySelectorAll('.swiper-pagination-bullet');
			let slide = document.querySelectorAll('.swiper-slide');
			let timeSlaid = 8000; // время автопролистывания

			let startInterval = setInterval(() => {
				slide.forEach((item, index) => {

					if (item.classList.contains('swiper-slide-visible')) {
						item.classList.add('--animate-start')
						if (slide.length - 1 === index) {
							setTimeout(() => {
								mainSwiper.slideTo(0)
							}, 2000)
						} else {
							setTimeout(() => {
								mainSwiper.slideNext()
							}, 2000)
						}
					}
				})

				setTimeout(() => {
					slide.forEach(item => {
						if (item.classList.contains('--animate-start')) {
							item.classList.remove('--animate-start')
						}
					})
				}, 3000)
			}, timeSlaid)

			mainSwiper.on('slideChange', () => {
				clearInterval(startInterval);

				setTimeout(() => {
					startInterval = setInterval(() => {
						slide.forEach((item, index) => {

							if (item.classList.contains('swiper-slide-visible')) {
								item.classList.add('--animate-start')
								if (slide.length - 1 === index) {
									setTimeout(() => {
										mainSwiper.slideTo(0)
									}, 2000)
								} else {
									setTimeout(() => {
										mainSwiper.slideNext()
									}, 2000)
								}
							}
						})
						setTimeout(() => {
							slide.forEach(item => {
								if (item.classList.contains('--animate-start')) {
									item.classList.remove('--animate-start')
								}
							})
						}, 3000)
					}, timeSlaid)
				}, 10)
			})

			slideBtn.forEach(item => {
				item.addEventListener('click', () => {
					for (let i = 0; i < slideBtn.length; i++) {
						if (item === slideBtn[i]) {
							slide.forEach(item => {
								if (item.classList.contains('swiper-slide-visible')) {
									item.classList.add('--animate-start')
								}
							})
							slideBtn.forEach(x => {
								x.classList.remove('swiper-pagination-bullet-active');
							})
							item.classList.add('swiper-pagination-bullet-active');
							setTimeout(() => {
								mainSwiper.slideTo(i)
							}, 2000)
							setTimeout(() => {
								slide.forEach(item => {
									if (item.classList.contains('--animate-start')) {
										item.classList.remove('--animate-start')
									}
								})
							}, 3000)

						}
					}
				})
			})
		}
	}

	mainSwaiper()
	// catalog swiper
	function catalogSwiper() {
		const swiperBox = document.querySelector('.catalog-swiper');
		if (swiperBox) {
			const swiper = new Swiper('.catalog-swiper', {

				slidesPerView: 4,
				slidesPerColumn: 1,
				spaceBetween: 20,
				navigation: {
					nextEl: '.catalog-button-next',
					prevEl: '.catalog-button-prev',
				},

			});
			const btn = document.querySelectorAll('.catalog-btn');
			const catalogBox = document.querySelectorAll('.catalog-box-container');
			if (btn && catalogBox) {
				btn.forEach(item => {
					if (item.classList.contains('--active')) {
						let dataArr = item.getAttribute('data-catalog');
						catalogBox.forEach(e => {
							if (e.classList.contains(dataArr)) {
								e.classList.add('--active')
							} else {
								e.classList.remove('--active')
							}
						})
						swiper.updateSlides()
					}

					item.addEventListener('click', () => {
						let dataArr = item.getAttribute('data-catalog');
						btn.forEach(i => {
							i.classList.remove('--active')
						})
						item.classList.add('--active')
						catalogBox.forEach(e => {
							if (e.classList.contains(dataArr)) {
								e.classList.add('--active')
							} else {
								e.classList.remove('--active')
							}
						})
						swiper.updateSlides()
					})
				})
			}
		}
	}
	catalogSwiper();

	// blog swiper
	function blogSwiper() {
		const blogBox = document.querySelector('.blog-swiper');
		if (blogBox) {
			const swiper = new Swiper(blogBox, {
				loop: true,
				slidesPerView: 4,
				slidesPerColumn: 1,
				spaceBetween: 20,
				navigation: {
					nextEl: '.blog-button-next',
					prevEl: '.blog-button-prev',
				},

			});
		}
	}
	blogSwiper();

	// map swiper
	function mapSwiper() {
		const mapBox = document.querySelectorAll('.map-slaider');
		if (mapBox) {
			mapBox.forEach(item => {
				const swiper = new Swiper(item, {
					loop: true,
					slidesPerView: 1,
					slidesPerColumn: 1,
					navigation: {
						nextEl: '.map-button-prev',
						prevEl: '.map-button-next',
					},

				});
			})

		}
	}
	mapSwiper()
	// start анимации

	function animateCircleFooter() {
		// Получить заголовок
		let start = document.getElementById('brend');

		let blockAnim = document.querySelector('.brend-title');
		let blockRow = document.querySelectorAll('.brend-row');
		let blockRowTwo = document.querySelectorAll('.brend-row-2');
		if (start && blockAnim) {

			window.addEventListener('scroll', () => {
				let startPos = start.offsetTop;
				let brendWidth = document.querySelector('.brend-title-row').offsetWidth - blockAnim.offsetWidth;
				if (window.pageYOffset + window.screen.availHeight > startPos && start.offsetHeight + startPos > window.pageYOffset) {
					let t = window.pageYOffset + window.screen.availHeight - startPos;
					let lengthBox = start.offsetHeight + window.screen.availHeight;
					if (t < 0) {
						blockAnim.style.transform = `translateX(0px)`
					} else if (t > brendWidth) {
						blockAnim.style.transform = `translateX(${brendWidth * (-1)}px)`
					} else {
						blockAnim.style.transform = `translateX(${t * (-1)}px)`
					}

					blockRow.forEach(item => {


						if (lengthBox > item.innerHTML.length) {
							let num = item.innerHTML.length;
							while (lengthBox > num) {
								let box = item.cloneNode(true);
								item.appendChild(box)
								num = item.innerHTML.length
							}
						}

						item.style.transform = `translateX(${t}px)`
					})
					blockRowTwo.forEach(item => {
						if (lengthBox > item.innerHTML.length) {
							let num = item.innerHTML.length;
							while (lengthBox > num) {
								let box = item.cloneNode(true);
								item.appendChild(box)
								num = item.innerHTML.length
							}
						}
						item.style.transform = `translateX(${t * (-1)}px)`

					})
				}
			})

		}
	}
	animateCircleFooter();

	// function brend tab

	function brendTab() {
		const btn = document.querySelectorAll('.brend-btn');
		const box = document.querySelectorAll('.brend-container');
		if (btn && box) {
			btn.forEach(item => {
				item.addEventListener('click', () => {
					let dataArr = item.getAttribute('data-brand');
					let id = document.getElementById(dataArr);
					btn.forEach(e => {
						e.classList.remove('--active');
					})
					box.forEach(e => {
						e.classList.remove('--active')
					})
					id.classList.add('--active')
					item.classList.add('--active')
				})
			})
		}
	}
	brendTab();
})